import styled from "styled-components";
export const HomeWrapper = styled.div`
    padding-bottom: 2.5rem;
`
export const BannerWrapper = styled.div`
    width: 100%;
    height: 70vh;
    overflow: hidden;
    .slick-prev {
        color: red;
        left: 0 !important;
        background: red;
    }

`
